import React from 'react';
import styled from 'styled-components';
import {setFlex} from '../../utilities';

const SlideThree = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE 3</h3>
    </div>
  );
}

const SThree = styled(SlideThree)`
  ${setFlex()};
  color: white;
  width: 100%;
  height: 70vh;
  font-size: 4rem;
`;

export default SThree;
